What factors determine professional level of artist and the value?

- the QUALITY of art;

- the price of the last sales of his/her paintings;

- number of art sold and at what price during the career;

- number of international art shows, fairs , art exhibitions the artist participated (international and national, solo and group)

- the number of museum exhibitions he participated and museum collections the art belongs to;

- presentations by galleries and the level of galleries ; 

- geographical scale of presentations of the artist's paintings

-Art auction record sales;

- the length of artist’s career on professional market

